import React, { Component } from 'react';
import {Row, Col, Breadcrumb, Container, CardBread} from 'reactstrap';
import parse from 'html-react-parser';

class BreadCrumbs extends Component{

    constructor(props) {
		super(props);
		this.state = {};
	}

	render(){
		const pos = {breadcrumb:{size:10, offset:1}}
		return(
			<Breadcrumb>
			<Row>
				<Col xs={pos.breadcrumb} sm={pos.breadcrumb} md={pos.breadcrumb} className="BreadCol">
					<Container fluid={true}>
						{parse("Electrónica, Audio y Video > iPod > Reproductores > iPod touch > <b>32 GB</b>")}
					</Container>
				</Col>
			</Row>
			</Breadcrumb>
		)
	}
}

export default BreadCrumbs;
